import React from 'react';

export default class Gala extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <div className="page">
        <div>
          <h3>Gala</h3>
          <div className="row">
            <div className="deco left"></div>
            <p className="right text">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam posuere ex nec ipsum cursus, non ultrices velit mollis. Sed massa ligula, bibendum eget tincidunt eu, venenatis at erat. Nunc at enim tortor. Nulla fringilla leo sed nisl molestie volutpat. Quisque imperdiet lectus sem, in pellentesque arcu consectetur ac. Cras blandit, nisl nec hendrerit congue, turpis sem consectetur dolor, ac sollicitudin odio leo eget elit. Morbi lacinia gravida tortor eget lacinia. Duis vel turpis gravida, suscipit purus et, commodo ipsum. Vestibulum mattis augue ligula, in rhoncus nibh finibus mollis. Ut vulputate a erat in mollis. Quisque porttitor ipsum et mi congue dapibus. Nulla tincidunt sit amet mauris id feugiat. In volutpat mollis ornare. Nunc tempor quis nulla id feugiat. Aenean ultrices rutrum neque a pretium. Nulla rhoncus erat at elit auctor, vel efficitur justo hendrerit.
            </p>
          </div>
        </div>
      </div>
    );
  }
}
